import React from "react";
import { VictoryPie } from "victory";
const Charts = () => {
  return (
    <VictoryPie
      animate={{
        duration: 2000
      }}
      categories={{ x: ["dogs", "cats", "mice"] }}
      data={[
        { x: "Cats", y: 35 },
        { x: "Dogs", y: 40 },
        { x: "Birds", y: 55 }
      ]}
    />
  );
};

export default Charts;
